        },

        {
          dataField: "invoiceId",
          text: "#Invoice Id",

        },
        {
          dataField: "email",
          text: "Writer email",

        },
        {

            dataField: "status",
            text: "status",


        },

        {

          dataField: "pdate",
          text: "Expected-Day-Pay",


      },
        {
            dataField: "Action",
            text: "Action",

          }
      ];
      const products=[]
    return <>
             <TableCard 
             products={products}
             columns={columns}
              title={"PENDING PAYMENTS"}
             />
          </>

}
export default PendingPayments;
